imeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"453210","type":"CustomJS"},{"attributes":{},"id":"453406","type":"StringEditor"},{"attributes":{},"id":"453384","type":"StringEditor"},{"attributes":{"fill_alpha":0.1,"fill_color":"#ffffea","hatch_alpha":0.1,"line_alpha":0.1,"line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"452955","type":"Patch"},{"attributes":{},"id":"453407","type":"StringFormatter"},{"attributes":{},"id":"453385","type":"StringFormatter"},{"attributes":{},"id":"453274","type":"AllLabels"},{"attributes":{},"id":"453408","type":"StringEditor"},{"attributes":{},"id":"453386","type":"StringEditor"},{"attributes":{},"id":"453409","type":"StringFormatter"},{"attributes":{},"id":"453196","type":"AllLabels"},{"attributes":{},"id":"453387","type":"StringFormatter"},{"attributes":{"source":{"id":"453320"}},"id":"453337","type":"CDSView"},{"attributes":{},"id":"453199","type":"UnionRenderers"},{"attributes":{"children":[[{"id":"452920"},0,0],[{"id":"453066"},1,0],[{"id":"452880"},2,0],[{"id":"453117"},3,0]]},"id":"453281","type":"GridBox"},{"attributes":{},"id":"453410","type":"StringEditor"},{"attributes":{},"id":"453068","type":"DataRange1d"},{"attributes":{},"id":"453388
